/* Procedure structure for procedure `get_po_item_list` */

/*!50003 DROP PROCEDURE IF EXISTS  `get_po_item_list` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `get_po_item_list`(
	IN po_id INT
    )
BEGIN
    SELECT
 	a.po_detail_item,
	a.order_no,
	a.item_code,
	a.description,
	a.remarks,
	a.delivery_date,
	a.qty_invoiced,
	a.unit_price,
	a.act_price,
	a.std_cost_unit,
	a.quantity_ordered,
	a.quantity_received,
	a.dc_per,
	a.dc_amnt,
	a.vat_type,
	a.vat,
	a.vatable_sales,
	a.total_amnt,
	a.units,
	IF (ISNULL(a.qty_received),0,a.qty_received) AS 'qty_received',
	IF (ISNULL(a.is_package),0,a.is_package) AS 'is_package',
	a.order_package 
    FROM
	(SELECT 
		po.po_detail_item,
		po.order_no,
		po.item_code,
		po.description,
		po.remarks,
		po.delivery_date,
		po.qty_invoiced,
		po.unit_price,
		po.act_price,
		po.std_cost_unit,
		po.quantity_ordered,
		po.quantity_received,
		po.dc_per,
		po.dc_amnt,
		po.vat_type,
		po.vat,
		po.vatable_sales,
		po.total_amnt,
		sm.units,
		(SELECT SUM(qty_recd) FROM 0_grn_batch r, 0_grn_items rr WHERE r.id = rr.grn_batch_id AND r.purch_order_no = po_id AND rr.item_code = po.item_code) AS 'qty_received',
		(SELECT COUNT(stock_id) FROM 0_item_package_detail WHERE main_stock_id = po.item_code) 'is_package',
		0 AS 'order_package'
	FROM 
		0_purch_order_details po, 
		0_stock_master sm
	WHERE 
		po.item_code=sm.stock_id AND order_no = po_id
	UNION
	SELECT 
		0 'po_detail_item',
		0 'order_no',
		i.stock_id 'item_code',
		i.description 'description',
		"" AS 'remarks',
		"" AS 'delivery_date',
		0 AS 'qty_invoiced',
		0 AS 'unit_price',
		0 AS 'act_price',
		0 AS 'std_cost_unit',
		0 AS 'quantity_ordered',
		0 AS 'quantity_received',
		0 AS 'dc_per',
		0 AS 'dc_amnt',
		0 AS 'vat_type',
		0 AS 'vat',
		0 AS 'vatable_sales',
		0 AS 'total_amnt',
		i.units,
		0 AS 'qty_received',
		1 AS 'is_package',
		1 AS 'order_package'
	FROM 0_stock_master i,
		0_item_package_detail ii,
		0_purch_order_details po
	WHERE  i.stock_id = ii.main_stock_id AND ii.stock_id = po.item_code AND order_no =po_id
	)a;
    END */$$
DELIMITER ;

